import React from "react";
import bg from "../assets/bg";
import '../assets/home.css'
const Home = () => {
    return (
        <div className="container">
            <div className="Content">
                <div className="SubContent">
                    <img src={bg} alt="Home" />

                </div>
            </div>
        </div>
    );
};

export default Home;
